import Container from 'react-bootstrap/Container';
import {Routes, Route, Link} from 'react-router-dom'
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { LinkContainer } from 'react-router-bootstrap';

function App() {
  return (
    <div className="App">
      <Navbar className='header' bg="light" expand="lg">
        <Container fluid>
          <Navbar.Brand> React Basics </Navbar.Brand>
          <Navbar.Toggle aria-controls="navbarScroll" />
            <Navbar.Collapse id="navbarScroll">
            <Nav className='me-auto my-2 my-lg-0'
                style={{maxHeight: '100px'}}
                navbarScroll
                variant="pills"
            >
                <Nav.Link className='module'> 1. Anatomy of React </Nav.Link>


              <Nav.Link className='module'> 2. Data & State </Nav.Link>


              <Nav.Link className='module'> 3. Navigation & Assets </Nav.Link>

              <Nav.Link className='module'> 4. Portfolio</Nav.Link>


            </Nav>
            </Navbar.Collapse>
        </Container>
      </Navbar>
    </div>
  );
}

export default App;
